import React, { Component } from 'react';

const list = [
  {
    "id": 1, 
    "title": "One todo",
    "body": "one todo"
  },
  {
    "id": 1, 
    "title": "Two todo", 
    "body": "two todo"
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { list };
  }
  render() {
    return (
      <div>
        {this.state.list.map}
      </div>
    )
  }
}
export default App;
